import MPActionBtn from "../MP-ActionBtn/MP-ActionBtn.vue";
export default {
  components: {
    MPActionBtn
  },
  data() {
    return {};
  },
  methods: {
    onEdit() {
      const isTransportRent = this.getSelectedItem.data?.rentType;
      this.$router.push(`/MarketPlace/createListing/${isTransportRent ? "transportRent" : "edit"}`);
    }
  },
  computed: {
    getSelectedItem() {
      return this.$store.getters["marketPlace/getSelectedItem"];
    }
  }
};
